import React from 'react'
import './Card.css';

const Card = (props) => {
  return (
    <div className='card'>
      <ul>
        {props.people.map((person) => {
        <>
          <li key={person.name+person.birthday}>person.name</li>
          <li key={person.name+person.birthday}>person.birthday</li>
        </>
        })}
      </ul>
    </div>
  )
}

export default Card
